package vn.com.kodergang.shop.entity;import javax.persistence.*;import java.util.Date;@Entity@Table(name = "AD_USER")public class AdUser {    @Id    @Column(name = "USER_ID")    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Integer userId;    @Column(name = "USERNAME")    private String username;    @Column(name = "FULLNAME")    private String fullname;    @Column(name = "EMAIL")    private String email;    @Column(name = "PASS")    private String pass;    @Column(name = "CREATE_TIME")    private Date createTime;    @Column(name = "LAST_LOGIN")    private Date lastLogin;    @Column(name = "UPDATE_TIME")    private Date updateTime;    @Column(name = "PHONE")    private String phone;    @Column(name = "STATUS")    private String status;    @Column(name = "ADDRESS")    private String address;    public Integer getUserId() {        return userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getFullname() {        return fullname;    }    public void setFullname(String fullname) {        this.fullname = fullname;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getPass() {        return pass;    }    public void setPass(String pass) {        this.pass = pass;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public Date getLastLogin() {        return lastLogin;    }    public void setLastLogin(Date lastLogin) {        this.lastLogin = lastLogin;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public String getAddress() {        return address;    }    public void setAddress(String address) {        this.address = address;    }}